import Map from './map'

function HomeBody() {
    return (
        <div className="py-11 flex h-3/4 w-3/4">
              
                <div className="w-2/4 h-full bg-red-400 "></div>
                <div className="w-2/4 h-full bg-yellow-50">
                    <Map></Map>
                </div>
            
        </div>
    )
}

